+.sidebar {
+  height: 100%;
+  background-color: #001529;
+  color: rgba(255, 255, 255, 0.65);
+  transition: all 0.3s;
+
+  :global {
+    .ant-menu {
+      background-color: transparent;
+      border-right: none;
+
+      .ant-menu-item {
+        margin: 4px 0;
+        border-radius: 4px;
+        transition: all 0.3s;
+
+        &:hover {
+          color: #fff;
+          background-color: rgba(255, 255, 255, 0.1);
+        }
+
+        &.ant-menu-item-selected {
+          color: #fff;
+          background-color: #1890ff;
+
+          &::after {
+            display: none;
+          }
+        }
+
+        .anticon {
+          font-size: 16px;
+        }
+      }
+
+      .ant-menu-submenu {
+        .ant-menu-submenu-title {
+          margin: 4px 0;
+          border-radius: 4px;
+          transition: all 0.3s;
+
+          &:hover {
+            color: #fff;
+            background-color: rgba(255, 255, 255, 0.1);
+          }
+        }
+
+        &.ant-menu-submenu-selected {
+          > .ant-menu-submenu-title {
+            color: #fff;
+          }
+        }
+      }
+    }
+
+    .ant-layout-sider-trigger {
+      background-color: #002140;
+      border-top: 1px solid rgba(255, 255, 255, 0.1);
+    }
+  }
+
+  .logo {
+    height: 64px;
+    padding: 16px;
+    display: flex;
+    align-items: center;
+    justify-content: center;
+    background-color: #002140;
+    border-bottom: 1px solid rgba(255, 255, 255, 0.1);
+
+    img {
+      height: 32px;
+    }
+
+    h1 {
+      margin: 0 0 0 12px;
+      color: #fff;
+      font-size: 18px;
+      font-weight: 600;
+      white-space: nowrap;
+    }
+  }
+}

